Để đánh giá $|(4+2i)|\cdot|(6-3i)|$, chúng ta sẽ tính toán hai phần tử riêng rẽ đó là:
$$|4+2i| = |4| + |2i| = 4 + 2i$$
$$|6-3i| = |6| - |3i| = 6 - 3i$$
Thay đổi i thành một giá trị thực tương ứng với giá trị của i, ta có:
$$|4+2i| = 4 + 2i$$
$$|6-3i| = 6 - 3i$$
Kết quả cuối cùng là:
$$|4+2i| = 4 + 2i = 4 + 2(1) = 4 + 2 = 6$$
$$|6-3i| = 6 - 3i = 6 - 3(1) = 6 - 3 = 3$$
Vì vậy, $|(4+2i)|\cdot|(6-3i)| = 6 \cdot 3 = 18$.

